import ClipLoader from "react-spinners/ClipLoader";



export const Loading = ({ loading }) => {
  return (
    <div className="w">
      <ClipLoader
        loading={loading}   
        size={150}
        aria-label="Loading Spinner"
        data-testid="loader"
      />
    </div>
  );
};
